import React from 'react';
import { Carousel, Col, Container, Row } from 'react-bootstrap';
import './Projects.css';

const Projects = () => {
    return (
        <div className="project-section">
            <Container>
                <div className="text-center">
                    <h2 className="title">My Portfolio</h2>
                </div>
                <Row>
                    <Col md={4}>
                        <div className="project-card">
                            <Carousel controls={false} className="carousel">
                                <Carousel.Item interval={1000}>
                                    <img
                                        className="d-block w-100 project-img"
                                        src="https://i.ibb.co/zszDr2r/screely-1638277816457.png"
                                        alt="First slide"
                                    />
                                </Carousel.Item>
                                <Carousel.Item interval={500}>
                                    <img
                                        className="d-block w-100 project-img"
                                        src="https://i.ibb.co/yXV7s9W/screely-1638277849991.png"
                                        alt="Second slide"
                                    />
                                </Carousel.Item>
                                <Carousel.Item>
                                    <img
                                        className="d-block w-100 project-img"
                                        src="https://i.ibb.co/PMK4bRy/screely-1638277913867.png"
                                        alt="Third slide"
                                    />
                                </Carousel.Item>
                            </Carousel>
                        </div>
                    </Col>
                </Row>
            </Container>
        </div>
    );
};

export default Projects;



